    false,nt"url": null,nt"notes": "The management plan is to maintain Ash
    Meadows Refuge as a natural ecosystem. To accomplish this, the area will be restored
    as much as possible to conditions which existed prior to agricultural development.
    For example, concrete irrigation ditches will be removed and spring outflows will
    be redirected to former streams; farm fields will be allowed to revert back to native
    vegetation; historic marshes will be restored and, for aesthetic purposes, all unnecessary
    fences, power lines and buildings will be removed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
